import './App.css';

function App() {
  return (
    <div>
      <header className="header">
        <div className="logo">
          <span className="title">공간디자인그룹</span>
          <span>call 031-546-1999</span>
        </div>
        <nav className="gnb">
          <ul>
            <li>회사소개</li>
            <li>제품소개</li>
            <li>시공사례</li>
            <li>온라인상담</li>
          </ul>
        </nav>
      </header>
    </div>
  );
}

export default App;
